    false,nt"url": null,nt"notes": "Estimated shallow-water, depth maps were
    produced using rule-based, semi-automated image analysis of high-resolution satellite
    imagery for nine locations in the Northwestern Hawaiian Islands. This project is
    a cooperative effort between the National Oceanic and Atmospheric Administration,
    State of Hawaii Department of Land and Natural Resources, and the U.S. Fish and
    Wildlife Service to produce benthic habitat maps and georeferenced imagery for the
    Northwestern Hawaiian Islands. This project was conducted in support of the U.S.
    Coral Reef Task Force.",nt"license_title": null,nt"extras": [{ntt"key":
